import React, {Component} from 'react';
import {ContentListWrapper} from '../style';
import {connect} from 'react-redux';

class HomeList extends Component {
	render() {
		return (
			<ContentListWrapper>
				{
					listItem.map((item) => {
						return (
							<li className='listItem haveImg'>					
								<div className='content'>
									<h3><a href='/' className='listHerf'>{item.get('title')}</a></h3>
									<p className='listPrap'></p>
									<div className='meta'>
									<span className='iconfont diamond'>&#xe63d; 6.2</span>
									<span className='writerName'>风w秋w寒</span>
									<span className='iconfont'>&#xe62f; 0</span>
									<span className='iconfont'>&#xe601; 37</span>
									</div>
								</div>
								<img src={item.get('picUrl')}  className='itemImg' alt='itemImage'/>
							</li>
						)
					})
				}
				
				<li className='listItem haveImg'>					
					<div className='content'>
						<h3><a href='/' className='listHerf'>我就是我，别人取代不了的烟火</a></h3>
						<p className='listPrap'>我不完美，但我真实 我不优秀，但我努力 我不漂亮，但我善良 我不富足，但我知足 我不会说话，但我真诚 这就是我 我喜欢和直来直去的人相处 可以毫...</p>
						<div className='meta'>
						<span className='iconfont diamond'>&#xe63d; 6.2</span>
						<span className='writerName'>风w秋w寒</span>
						<span className='iconfont'>&#xe62f; 0</span>
						<span className='iconfont'>&#xe601; 37</span>
						</div>
					</div>
					<img src='./images/listImg1.jpg'  className='itemImg' alt='itemImage'/>
				</li>
			</ContentListWrapper>
		)
	}
}

const mapStateToProps = (state) => {
	return {
		listItem: state.get('home').get('listItem')
	}
}

export default connect(mapStateToProps, null)(HomeList);
